import React from 'react'
import style from "./review.module.css";
import { IoIosArrowDown } from 'react-icons/io';



const Review = ({
    jobDescription,   
    company, 
    reviewBody, 
    country, 
    reaction1, 
    reaction2, 
    reaction3, 
    reaction4,
    reviewId

    }) => { 

     //const reactionPath = '../../emoji/' + reaction + '.png';
    return (
        <div className={style.review}>
            <div className={style.reviewHeader}>
                <h1 className={style.jobDescription}> { jobDescription } </h1>
                <p className={style.company}>  {company} </p>
                <img className={style.country} 
                src="https://flagcdn.com/w20/se.png"
                srcset="https://flagcdn.com/w40/se.png 2x" 
                alt="Sweden" /> 
                </div>
                <p> {reviewBody} </p>

            <div className={style.reviewFooter}>
                <p className={style.readMore}>Read More</p>
                <i className={style.arrowdownIcon}> {IoIosArrowDown} </i>

                <img src="/badEmoji.png" alt="Sad" />
                <img src={reaction1} alt="" />
                <img src={reaction2} alt="" />
                <img src={reaction3} alt="" />
                <img src={reaction4} alt="" />

            </div>
        </div>
    );
};

export default Review;


